async function resolveJsonRefs(msg) {
    const schema = msg.payload;
    try {
        const resolvedSchema = await jsonRefs.resolveRefs(schema);
        msg.payload = resolvedSchema.resolved;
        return msg;
    } catch (error) {
        throw new Error('Failed to resolve JSON references: ' + error.message);
    }
}

